export function createSVGMaskURL(text, width, height, x, y, anchor, fontSize) {
  const svg = `<svg height="${height}" width="${width}" xmlns="http://www.w3.org/2000/svg" xmlns:xlink= "http://www.w3.org/1999/xlink">
    <defs>
      <style>
        @font-face {
      font-family: 'glacial_indifferenceregular';
      src: url(data:application/font-woff2;charset=utf-8;base64,) format('woff2'),
           url(data:application/font-woff;charset=utf-8;base64,) format('woff');
      font-weight: normal;
      font-style: normal;
        }
      </style>
      <mask id="myMask">
        <rect width="100%" height="100%" fill="white"></rect>
        <text id="number" x="${x}" y="${y}" text-anchor="${anchor}" fill="black" font-size="${fontSize}" dy=".4em" font-family="glacial_indifferenceregular">${text}</text>
      </mask>
    </defs>
    <rect width="100%" height="100%" fill="white" mask="url(#myMask)"/>
  </svg>`;
  const blob = new Blob([svg], {type: 'image/svg+xml'});
  const url = URL.createObjectURL(blob);
  return url;
}